import React from 'react';
import Sidebar from './Sidebar/Sidebar';
import Feed from './Feed/Feed';
import Wedgets from './Wedgets/Wedgets';

const Home = () => {
    const user = userAuthState(auth)
    const handleLogout=()=>{
        signOut(auth)
    }
    return (
        <div className='app'>
            <Sidebar handleLogout={handleLogout} user={user} />
            <Feed />
            <Wedgets />
        </div>
    );
}

export default Home;
